<!doctype html>
<html>

<head>
  <meta charset="utf-8">
  <title>ZeroOne</title>
  <style>
    html {
      height: 100%;
    }

    body {
      position: relative;
      height: calc(100% - 6px);
      margin: 0;
      overflow: hidden;
      background-color: #fff;
      border: 3px solid #000;
    }

    .app-logo {
      position: absolute;
      right: -3px;
      bottom: -3px;
    }

    h1 {
      margin: 0;
      color: rgba(0, 0, 0, 0.7);
      font-weight: 300;
      font-size: 18px;
      line-height: 21px;
    }

    .center {
      position: absolute;
      top: 50%;
      left: 50%;
      text-align: center;
      transform: translate(-50%, -50%);
    }

    .loader {
      position: relative;
      display: inline-block;
      width: 14px;
      height: 14px;
      margin: 20px;
      background-color: #000;
    }

    .loader:before {
      position: absolute;
      top: 50%;
      left: 50%;
      z-index: -1;
      width: 26px;
      height: 26px;
      border: 1px solid #000;
      transform: translate(-50%, -50%);
      animation: loaderSpin 2s ease-in infinite;
      content: '';
    }

    .loader:after {
      position: absolute;
      top: 50%;
      left: 50%;
      z-index: -1;
      color: #fff;
      font-weight: bolder;
      font-size: 102px;
      line-height: 26px;
      transform: translate(-50%, -50%);
      animation: loaderSpin 2s ease-in infinite;
      content: "+";
    }

    .loader-text {
      display: block;
    }

    @keyframes loaderSpin {
      0% {
        transform: scale(1) translate(-50%, -50%) rotate(0deg);
      }

      10%,
      20% {
        transform: scale(1.4) translate(-35%, -35%) rotate(0deg);
      }

      30%,
      45% {
        transform: scale(1.4) translate(-35%, -35%) rotate(-90deg);
      }

      55%,
      100% {
        transform: scale(1) translate(-50%, -50%) rotate(-90deg);
      }
    }
  </style>
  <meta name="viewport" content="width=device-width, initial-scale=1">
